const ImageGridListStyle = theme => ({
	root: {
	    flexGrow: 1,
	    backgroundColor: theme.palette.background.paper,
	},
	tabsRoot: {
    	borderBottom: '1px solid #e8e8e8',
	},
	tabsIndicator: {
		backgroundColor: '#1890ff',
	},

});

export default ImageGridListStyle;
